import { Button } from "react-bootstrap";
import { ViewList } from "react-bootstrap-icons";
import { Link, Navigate, Route, Routes } from "react-router-dom";
import AllList from "../component/AllList";
import FormList from "../component/FormList";

function AllRoutsRTK() {
    return (
        <>
            <Routes>
                <Route path="/" element={<Navigate to="/lists" />} />
                <Route path="/lists" element={<AllList />} />
                <Route path="/list/edit/:id" element={<FormList />} />
                <Route path="/list/add" element={<ViewList />} />
                <Route path="/list/view/:id" element={<AllList />} />
            </Routes>
            
        </>
    )
}
export default AllRoutsRTK
